	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 297px; min-height: 450px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 5px; top: 5px; width: 287px; min-height: 440px;\"><p style=\"text-align:left\"><span style=\"font-family: &quot;Arial Black&quot;, sans-serif; color: rgb(0, 0, 0); font-size:12pt;\">Notasjon (skrivemåte)</span></p>\n\n<p style=\"text-align:left\"><span style=\"font-family: &quot;Arial Black&quot;, sans-serif; color: rgb(0, 0, 0); font-size:12pt;\">for grunnstoffer</span></p>\n\n<p style=\"text-align:left\"><span style=\"font-family: &quot;Arial Black&quot;, sans-serif; color: rgb(0, 0, 0); font-size:12pt;\">​</span></p>\n\n<p><span style=\"font-size:12pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0);\">Når vi skriver navnet på et grunnstoff, bruker vi ofte det kjemiske symbolet til grunnstoffet. Symbolet er på én eller to bokstaver, ofte hentet fra det greske eller latinske navnet på grunnstoffet. Den første bokstaven i symbolet er alltid stor, og den andre er liten. Atomnummeret er det samme som antall protoner i kjernen, og blir skrevet med senket skrift foran det kjemiske symbolet. Nukleontall er summen av antall protoner og nøytroner i kjernen. Det står med hevet skrift foran det kjemiske symbolet.</span></p>\n\n<p><span style=\"font-size:12pt; background-color: transparent;\">Denne skrivemåten bruker vi blant annet når vi ønsker å skille mellom ulike typer av samme grunnstoff.</span></p>\n\n<p><span style=\"font-size:12pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0);\">​</span></p>\n\n<p><span style=\"font-size:12pt; font-family: Arial, sans-serif; color: rgb(0, 0, 0);\">​</span></p></div></div>",
